class Ingredient():
    def __init__(self, name):
        self.name = name
        self.needs_recipe = []
        self.needs_ingredient = []

    def __str__(self):
        return f'{self.name}'

    def __repr__(self):
        '''out = '['
        for need in self.needs:
            out += f' {need.name},'
        out = out[0:len(out)]
        out += ']'
        return out'''
        return self.name

    def __eq__(self, other):
        if isinstance(other, str):
            return self.name == other

    def __hash__(self):
        return self.name.__hash__()

class Solution:
    def connectionsGraph(self, recipes: List[str], ingredients: List[List[str]]):
        recipes_dict = {}
        for r_idx in range(len(recipes)):
            recipes_dict[recipes[r_idx]] = Ingredient(recipes[r_idx])

        for r_idx in range(len(recipes)):
            recipe = recipes_dict[recipes[r_idx]]

            for ingredient_name in ingredients[r_idx]:
                if ingredient_name in recipes_dict:
                    recipe.needs_recipe.append(recipes_dict[ingredient_name])
                else:
                    recipe.needs_ingredient.append(ingredient_name)
        return recipes_dict

    def getTopologicalOrdering(self, graph: Dict[str, Ingredient]):
        ordering = [recipe for key, recipe in graph.items()]
        gt_dag = {recipe : [] for key, recipe in graph.items()}
        lt_dag = {recipe : [] for key, recipe in graph.items()}
        for element_to_sort_idx in range(len(ordering)):
            element = ordering[element_to_sort_idx]
            for j in range(len(element.needs_recipe)):
                # Pointer from element to ordering[j]
                gt_dag[element].append(element.needs_recipe[j])
                lt_dag[element.needs_recipe[j]].append(element)
                    
        topo_ordering = []
        # There is an incoming edge in gt_dag[key] if something is a pre-req for a key in gt_dag.
        # If there is an element with no incoming edges that means nothing is a pre-req for it.
        no_incoming_elements = []
        for recipe, conn in gt_dag.items():
            if len(conn) == 0:
                no_incoming_elements.append(recipe)
        
        # Kahn's algorithm from https://en.wikipedia.org/wiki/Topological_sorting.
        while len(no_incoming_elements) > 0:
            start = no_incoming_elements.pop(0)
            #print(f'start = {start} is needed by {lt_dag[start]}')
            topo_ordering.append(start)
            
            for gt_recipe in lt_dag[start]:
                gt_dag[gt_recipe].remove(start)
                if len(gt_dag[gt_recipe]) == 0:
                    no_incoming_elements.append(gt_recipe)
                
        #print(f'topo2 ordering = {topo_ordering}')
        return topo_ordering
            
    def findAllRecipes(self, recipes: List[str], ingredients: List[List[str]], supplies: List[str]) -> List[str]:
        #print(f'recipes = {recipes} \ningredients = {ingredients} \nsupplies = {supplies}\n')
        connections = self.connectionsGraph(recipes, ingredients)
        ordered_recipes = self.getTopologicalOrdering(connections)
        #print(f'ordered = {ordered_recipes}')
        prepared = []
        supplies_dict = {name : True for name in supplies}

        for i in range(len(ordered_recipes)):
            recipe = ordered_recipes[i]
            needed = len(recipe.needs_recipe) + len(recipe.needs_ingredient)
            satisfied = 0
            count = 0
            for req in recipe.needs_recipe:
                count += 1
                if req.name in supplies_dict:
                    satisfied += 1

            for req in recipe.needs_ingredient:
                count += 1
                if req in supplies_dict:
                    satisfied += 1
            if needed == satisfied:
                prepared.append(recipe.name)
                # New supply has been created
                supplies_dict[recipe.name] = True

        return prepared

